import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {BrowserRouter as Pepe} from 'react-router-dom'

ReactDOM.render(
  <Pepe>
    <App />
  </Pepe>,
  document.getElementById('root')
);
